import React from "react";
import "../../Styles/Shared/FifthCard.scss";
import fifth1 from "../../Assets/svg/fifth1.svg";

function FifthCard() {
  return (
    <div className='fifthCard'>
      <div className='icon'>
        <img src={fifth1} alt='' />
      </div>
      <h4>A Check-out Experience Designed to Convert Shoppers</h4>
      <p>
        Shoppers breeze through checkout with a one click experience that gets
        60% higher conversions.
      </p>
    </div>
  );
}

export default FifthCard;
